Boulder Dash. Episode I: Dig The Past. The same game concept that proved to be unfading, but the appearance is brand new. This reworked version of Boulder Dash was created with true love for the original game. As kids we used to spend hours playing Boulder Dash and now that we have grown up to be pros we were able to contribute to the game on a professional level.
